"Bit printout"
import random
import struct


def float_to_hex(f):
    interim = str(hex(struct.unpack('>I', struct.pack('<f', f))[0])).upper()
    interim = interim[2:]
    return interim

def int_to_hex(i):
    interim2 = str(hex(struct.unpack('>I', struct.pack('<i', i))[0])).upper()
    interim2 = interim2[2:]
    return interim2

level = ""
level = level.upper()

#wave,duration,gems
wavelist = [(0,3,0),(1,6,2),(2,43,10),(3,81,49),(4,98,48),(5,106,18),(6,153,24),(7,197,174),(8,168,6),(9,217,18),(10,223,76),(11,233,15),(12,274,74),(13,348,74),(14,422,74),(15,496,74),(16,570,74),(17,644,74),(18,718,74),(19,792,74),(20,866,74),(21,940,74),(22,1014,74),(23,1088,74),(24,1162,74),(25,1236,74),(26,1310,74),(27,1384,74)]
monsterlist = [(2,'00000000','Squid I'),(3,'01000000','Squid III'),(3,'02000000','Squid III'),(1,'03000000','Spider I'),(1,'04000000','Spider II'),(25,'05000000','Centipede'),(50,'06000000','Gigapede'),(10,'07000000','Ghostpede'),(6,'08000000','Leviathan'),(0,'09000000','Thorn')]
spawncount = -1
wavespawns = []
for wave in wavelist:
    duration = wave[1]
    gems = wave[2]

    timeleft = duration



    while gems > 1:

        if gems > 11:
            span = 11
        else:
            span = gems

        spawn = random.choice(monsterlist)
        monster = ""
        time = 0



        if spawn[0] <= span:
            monster = spawn[0]
            gems -= spawn[0]
            time = random.randrange(0,timeleft,1)
            timeleft -= time
            timetext = float_to_hex(time)
            if len(timetext) < 8:
                for j in range(8-len(timetext)):
                    timetext = "0" + timetext

            wavespawns.append(str(wave[0]) + str(monster) + str(timetext) + "00000000000000000000")
            spawncount += 1
        else:
            pass



    timelefttext = float_to_hex(timeleft)
    if len(timelefttext) < 8:
        for j in range(8-len(timelefttext)):
            timelefttext = "0" + timelefttext


    wavespawns.append("FFFFFFFF" + str(timelefttext) + "00000000000000000000")
    spawncount += 1

spawntext = int_to_hex(spawncount)
if len(spawntext) < 8:
    for j in range(8-len(spawntext)):
        spawntext = "0" + spawntext

printout = ""
for line in wavespawns:
    printout = printout + str(line)
print(level + spawntext + printout)
